import React from 'react';

export default function PlaceCard({place, onOpen}){
  return (
    <div className="place-card" onClick={() => onOpen(place)}>
      <img src={place.default_photo || 'https://via.placeholder.com/300x160'} alt={place.name} />
      <div className="place-name">{place.name}</div>
    </div>
  );
}
